import './App.css';
import Home from './Page/Home';
import { Route, Routes, BrowserRouter } from 'react-router-dom';
import Login from './component/Login';
import Register from './component/Register';


function App() {
  return (
      <BrowserRouter>
    <div className="App">


        <Routes>
          <Route path="/home" element={<Home />} />
        </Routes>
    </div>
      </BrowserRouter>
  );
}

export default App;
